import { createStore } from "vuex";
import getters from "./getters";
import mutations from "./mutations";
import actions from "./actions";

export default createStore({
    state: {
        user: null,
        isLogin: false,
        logId: null, // 새로운 상태 추가
    },
    mutations,
    getters,
    actions,
});
